import React from 'react';
import Hero from '../Components/Hero'

import Content from '../Components/Content'


function About(props){
    return(
        <div>
            <Hero title={props.title} />

            <Content>
                <p>Hi there, thank you for visiting my website! My name is Arshdeep and I am currently a 3rd-year computer science student at Wilfred Laurier. My interests lie in the intersection of computer science and business. I love to complete projects because the knowledge I gain and the lessons I learn during the process are essential to my learning and growth. I am currently looking for opportunities to leverage my interests and expand my skill sets in the fields of business, web/app development, and Object-Oriented Design. My goal is to make a difference; I strive to use my abilities in order to devise a better society for the future generations and I am constantly seeking out new experiences that will assist me in meeting this objective. </p>

            </Content>

        </div>
    )
}

export default About;
